import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

function Login() {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const navigate = useNavigate();

    const handleLogin = async (event) => {
        event.preventDefault();
        try {
            const response = await axios.post('http://localhost:3001/login', { username, password });
            const token = response.data.token;
            localStorage.setItem('token', token);
            alert('Login successful');
            setUsername('');
            setPassword('');
            navigate('/');
            window.location.reload();
        } catch (error) {
            console.error('Login Error', error);
            alert('Login failed. Please check your credentials.');
        }
    };

    return (
        <div className="w-full h-screen flex bg-gray-900 dark:bg-gray-100 transition-colors duration-300">
            <div className="flex w-full h-full justify-center items-center">
                <form 
                    className="text-center border border-gray-700 dark:border-gray-300 rounded-lg w-[600px] h-[400px] p-9 bg-[#1a1a1a] dark:bg-white shadow-lg text-white dark:text-gray-900"
                    onSubmit={handleLogin}
                >
                    <label className="block text-lg mb-1 text-teal-400 dark:text-teal-600">Username</label>
                    <input
                        className="w-[400px] h-[40px] rounded-xl bg-zinc-700 dark:bg-gray-200 dark:text-gray-900 p-2 mb-6 focus:outline-none focus:ring-2 focus:ring-teal-500"
                        type="text"
                        placeholder="Enter your username"
                        value={username}
                        onChange={(e) => setUsername(e.target.value)}
                        required
                    />
                    <label className="block text-lg mb-1 text-teal-400 dark:text-teal-600">Password</label>
                    <input
                        className="w-[400px] h-[40px] rounded-xl bg-zinc-700 dark:bg-gray-200 dark:text-gray-900 p-2 mb-6 focus:outline-none focus:ring-2 focus:ring-teal-500"
                        type="password"
                        placeholder="Enter your password"
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        required
                    />
                    <button
                        className="w-[200px] h-[50px] border border-teal-500 hover:bg-teal-800 dark:hover:bg-teal-600 text-white dark:text-gray-100 rounded-xl transition duration-200"
                        type="submit"
                    >
                        Login
                    </button>
                </form>
            </div>
        </div>
    );
}

export default Login;
